import { Student } from "./student";

export enum Major {
  SI = 'SI',
  GE = 'GE',
  GB = 'GB',
  AI = 'AI'
}
export interface Ticket {
  title?: string;
  description?: string;
  date?: Date;
  student?: Student;
  major?: Major;
  archived?: boolean;
}
